import logements from '../../assets/data/logements.json'

function Card() {
     return (
          <div className='card'>
            <ul>
            {logements.map((logement) => (
                 <li key={logement.id}>
                      <img src={logement.picture} alt={logement.name} />
                      <h2>{logement.name}</h2>
                      <p>{logement.description}</p>
                 </li>
            ))}
            </ul>
          </div>
     )
}

export default Card
